import{_ as e,q as o,r as t,a2 as r}from"./plugin-vue_export-helper.c35c1c54.js";const k='{"title":"POI lines S02","description":["<img src=\\"https://s1.xptou.com/2022/10/06/633e336256664.jpg\\" />","Show x Root"],"frontmatter":{"page":false,"title":"POI lines S02","description":["<img src=\\"https://s1.xptou.com/2022/10/06/633e336256664.jpg\\" />","Show x Root"],"date":"2022-01-14T23:27:06.000Z","sidebar":true,"comment":true,"category":["Vedio"],"tags":["POI"]},"headers":[{"level":2,"title":"1.1. 00:25:17--00:29:47","slug":"_1-1-00-25-17-00-29-47"},{"level":2,"title":"2.1. 00:29:53--00:29:54","slug":"_2-1-00-29-53-00-29-54"}],"relativePath":"posts/vedio/poi-lines02.md","lastUpdated":1665020794417}',a={},n=r('<ul><li>S: Shaw</li><li>R: Root</li><li>H: Harald</li><li>J: John</li><li>L: Lionel</li></ul><h1 id="_1-s02e16" tabindex="-1">1. S02E16 <a class="header-anchor" href="#_1-s02e16" aria-hidden="true">#</a></h1><h2 id="_1-1-00-25-17-00-29-47" tabindex="-1">1.1. 00:25:17--00:29:47 <a class="header-anchor" href="#_1-1-00-25-17-00-29-47" aria-hidden="true">#</a></h2><p>S:</p><blockquote><p>Hello, Veronica. \u4F60\u597D\uFF0C\u7EF4\u7F57\u59AE\u5361</p></blockquote><p>R:</p><blockquote><p>Come in. \u8FDB\u6765\u5427\u3002</p></blockquote><p>S:</p><blockquote><p>Any chance you were followed? \u6709\u4EBA\u8DDF\u8E2A\u4F60\u5417\uFF1F</p></blockquote><p>R:</p><blockquote><p>I don&#39;t think so, but I haven\u2019t been in the filed since I was at the farm.<br> \u6211\u89C9\u5F97\u6CA1\u6709\u3002\u4E0D\u8FC7\u6211\u4ECE\u8BAD\u7EC3\u8425\u6BD5\u4E1A\u540E\u4E00\u76F4\u6CA1\u51FA\u8FC7\u5916\u52E4\u3002<br> You&#39;re Sam,right? Michael talk about you.<br> \u4F60\u662F\u8428\u59C6\uFF0C\u5BF9\u5417\uFF1F\u8FC8\u514B\u5C14\u8DDF\u6211\u8BF4\u8D77\u8FC7\u4F60\u3002<br> I mean,he didn&#39;t tell me about what you guys do or anying,but\u2026he liked you.<br> \u4ED6\u6CA1\u544A\u8BC9\u6211\u4F60\u4EEC\u662F\u505A\u4EC0\u4E48\u4E8B\u7684\u3002\u4E0D\u8FC7\uFF0C\u4ED6\u559C\u6B22\u4F60\u3002<br> What happened to him?<br> \u4ED6\u600E\u4E48\u4E86\uFF1F</p></blockquote><p>S:</p><blockquote><p>He was killed.<br> \u88AB\u6740\u4E86\u3002<br> On a mission.<br> \u6267\u884C\u4EFB\u52A1\u65F6\u3002<br> The less you know about all of this, the safer you&#39;ll be.<br> \u4F60\u5BF9\u8FD9\u4E9B\u77E5\u9053\u8D8A\u5C11\uFF0C\u5C31\u8D8A\u5B89\u5168\u3002<br> But I do need to know what he talked to you about.<br> \u4F46\u6211\u8981\u77E5\u9053\u4ED6\u5230\u5E95\u544A\u8BC9\u4F60\u4EC0\u4E48\u4E86\u3002</p></blockquote><p>R:</p><blockquote><p>Mike sent over details of wire transfers to a nuclear engineer named Daniel Aquino.<br> \u8FC8\u514B\u53D1\u7ED9\u6211\u4E00\u4E9B\u8D44\u91D1\u8F6C\u8D26\u4FE1\u606F\u662F\u8F6C\u7ED9\u6838\u7535\u5DE5\u7A0B\u5E08\u4E39\u5C3C\u5C14\xB7\u963F\u57FA\u8BFA\u7684\u3002<br> They appeared to originate out of accounts affiliated with Hezbollah, but someone had electronically spoofed the transfers.<br> \u8FD9\u4E9B\u8D44\u91D1\u770B\u8D77\u6765\u662F\u4ECE\u9ECE\u5DF4\u5AE9\u771F\u4E3B\u515A\u540D\u4E0B\u7684\u8D26\u6237\u4E2D\u53D1\u51FA\u7684\uFF0C\u4F46\u662F\u6709\u4EBA\u7BE1\u6539\u4E86\u90A3\u4E9B\u7535\u5B50\u8F6C\u8D26\u4FE1\u606F\u3002<br> I was able to track down the real originating accounts. They were out of the US government.<br> \u6211\u67E5\u5230\u4E86\u771F\u6B63\u8F6C\u51FA\u8D44\u91D1\u7684\u8D26\u6237\u3002\u8D44\u91D1\u662F\u4ECE\u7F8E\u56FD\u653F\u5E9C\u6C47\u51FA\u7684\u3002</p></blockquote><p>S:</p><blockquote><p>Which part of the government?<br> \u653F\u5E9C\u4EC0\u4E48\u90E8\u95E8\uFF1F</p></blockquote><p>R:</p><blockquote><p>A group out of the pentagon called the Intelligence Support Avtivity.<br> \u96B6\u5C5E\u4E94\u89D2\u5927\u697C\u7684\u7EC4\u7EC7\uFF0C\u540D\u53EB\u201C\u60C5\u62A5\u652F\u6301\u884C\u52A8\u5904\u201D\u3002<br> Have you heard of them?<br> \u4F60\u542C\u8BF4\u8FC7\u4ED6\u4EEC\u5417\uFF1F</p></blockquote><p>S:</p><blockquote><p>You could say that. Up until yesterday, I worked for them.<br> \u53EF\u4EE5\u8FD9\u4E48\u8BF4\uFF0C\u76F4\u5230\u6628\u5929\uFF0C\u6211\u8FD8\u5728\u4E3A\u4ED6\u4EEC\u5DE5\u4F5C\u3002</p></blockquote><p>R:</p><blockquote><p>Their budget&#39;s confidential, but\u2026it stretches back five years.<br> \u4ED6\u4EEC\u7684\u9884\u7B97\u8D44\u91D1\u662F\u673A\u5BC6\uFF0C\u4F46\u662F\u2026\u4ECE\u4E94\u5E74\u524D\u5C31\u5F00\u59CB\u4E86\u3002<br> Huge amounts coded to a project called &quot;Northern Lights&quot;.<br> \u5927\u7B14\u91D1\u989D\u90FD\u62E8\u7ED9\u4E86\u4E00\u4E2A\u53EB\u201C\u5317\u6781\u5149\u201D\u7684\u9879\u76EE\u3002</p></blockquote><p>S:</p><blockquote><p>What was the project?<br> \u8FD9\u662F\u4EC0\u4E48\u9879\u76EE\uFF1F</p></blockquote><p>R:</p><blockquote><p>I don&#39;t know. But Aquino was part of it.<br> \u6211\u4E0D\u77E5\u9053\uFF0C\u4F46\u662F\u963F\u57FA\u8BFA\u53C2\u4E0E\u4E86\u8FD9\u4E2A\u9879\u76EE\u3002<br> They built a facility of some kind coded as research. But I can&#39;t find the names of anyone else involved in the project.<br> \u4ED6\u4EEC\u5EFA\u7ACB\u4E86\u4E00\u4E2A\u53EB\u201C\u63A2\u7D22\u8005\u201D\u7684\u8BBE\u5907\u3002\u4F46\u6211\u67E5\u4E0D\u5230\u5176\u4ED6\u9879\u76EE\u53C2\u52A0\u8005\u7684\u540D\u5B57\u3002<br> Mike said Aquino told you the name of his contact in Northern Lights. Do you remember it?<br> \u9EA6\u514B\u8BF4\u963F\u57FA\u8BFA\u544A\u8BC9\u4E86\u4F60\u4ED6\u5728\u5317\u6781\u5149\u9879\u76EE\u4E2D\u8054\u7CFB\u4EBA\u7684\u540D\u5B57\u3002\u4F60\u8FD8\u8BB0\u5F97\u5417\uFF1F</p></blockquote><p>S:</p><blockquote><p>Stay here. And keep away from those windows.<br> \u5F85\u5728\u8FD9\u513F\u3002\u79BB\u7A97\u6237\u8FDC\u4E00\u70B9\u3002</p></blockquote><p>R:</p><blockquote><p>Veronica and I had a bit of a chat before you got here.<br> \u4F60\u6765\u4E4B\u524D\uFF0C\u7EF4\u7F57\u59AE\u5361\u548C\u6211\u95F2\u804A\u4E86\u4E00\u4F1A\u513F\u3002<br> She tried really, really hard to remember anything else that could help me, but... she didn&#39;t know anything.<br> \u5979\u975E\u5E38\u3001\u975E\u5E38\u52AA\u529B\u5730\u56DE\u5FC6\u6240\u6709\u5BF9\u6211\u6709\u5E2E\u52A9\u7684\u4E8B\u60C5\u3002\u4F46\u662F\uFF0C\u5979\u4E00\u65E0\u6240\u77E5\u3002<br> I read your file, and I&#39;m kind of a big fan.<br> \u6211\u770B\u8FC7\u4F60\u7684\u6863\u6848\uFF0C\u6211\u662F\u4F60\u7684\u5FE0\u5B9E\u7C89\u4E1D\u3002<br> So, I really don&#39;t wanna hurt you. I just need the name.<br> \u6240\u4EE5\uFF0C\u6211\u771F\u7684\u4E0D\u60F3\u4F24\u5BB3\u4F60\u3002\u6211\u53EA\u9700\u8981\u4E2A\u540D\u5B57\u3002<br> You really have no idea what you&#39;re caught up in, do you?<br> \u770B\u6765\u4F60\u6839\u672C\u4E0D\u77E5\u9053\u81EA\u5DF1\u5377\u5165\u4E86\u4EC0\u4E48\uFF0C\u662F\u5427\uFF1F<br> Who you&#39;re actually working for?<br> \u4E0D\u77E5\u9053\u4F60\u5230\u5E95\u662F\u5728\u4E3A\u8C01\u5DE5\u4F5C\uFF1F<br> Did you honestly think the source of the numbers was Guantanamo?<br> \u4F60\u771F\u7684\u76F8\u4FE1\u90A3\u4E9B\u53F7\u7801\u6765\u81EA\u5173\u5854\u90A3\u6469\u5417\uFF1F<br> Some sad taxi driver rotting away in a cage somewhere?<br> \u67D0\u4E2A\u53EF\u601C\u7684\u51FA\u79DF\u8F66\u53F8\u673A\u6B63\u88AB\u5173\u5728\u7B3C\u5B50\u91CC\u6162\u6162\u8150\u70C2\u5417\uFF1F<br> I mean, you should know torture almost never produces good information.<br> \u4F60\u5E94\u8BE5\u77E5\u9053\uFF0C\u4E25\u5211\u62F7\u6253\u51E0\u4E4E\u4ECE\u6765\u95EE\u4E0D\u51FA\u6709\u7528\u7684\u4FE1\u606F\u3002<br> Almost never.<br> \u51E0\u4E4E<br> Sadly, we are on a bit of a clock.<br> \u53EF\u60DC\u7684\u662F\uFF0C\u6211\u4EEC\u65F6\u95F4\u6709\u70B9\u7D27\u3002<br> Wilson&#39;s men started looking for Veronica here three hours ago.<br> \u5A01\u5C14\u68EE\u7684\u4EBA\u4E09\u5C0F\u65F6\u524D\u5C31\u5F00\u59CB\u5BFB\u627E\u7EF4\u7F57\u59AE\u5361\u4E86<br> Now\u2026<br> \u73B0\u5728<br> Aquino was hired to build a home for something very special, something I wanna find.<br> \u963F\u57FA\u8BFA\u53D7\u96C7\u4E3A\u4E00\u4E2A\u6781\u7279\u6B8A\u7684\u4E1C\u897F\u5EFA\u9020\u573A\u6240\uFF0C\u6211\u60F3\u627E\u7684\u4E1C\u897F\u3002<br> So you&#39;re gonna tell me the name of his contact.<br> \u6240\u4EE5\u544A\u8BC9\u6211\u4ED6\u8054\u7CFB\u4EBA\u7684\u540D\u5B57\u3002</p></blockquote><p>S:</p><blockquote><p>One of the things I left out of my file... I kind of enjoy this sort of thing.<br> \u6211\u7684\u6863\u6848\u91CC\u6709\u4E00\u70B9\u6F0F\u4E86\u3002\u6211\u5BF9\u8FD9\u79CD\u4E8B\u5176\u5B9E\u4E50\u5728\u5176\u4E2D\u3002</p></blockquote><p>R:</p><blockquote><p>I am so glad you said that.<br> \u6211\u771F\u9AD8\u5174\u4F60\u8FD9\u4E48\u8BF4\u3002<br> I do too.<br> \u6211\u4E5F\u662F\u5462\u3002<br> And just when we were starting to really connect.<br> \u6211\u4EEC\u521A\u8981\u5F00\u59CB\u4EB2\u8FD1\u4E00\u4E0B\u5462\u3002<br> I&#39;m sorry.A little rude, I know.<br> \u771F\u62B1\u6B49\u3002\u6709\u70B9\u65E0\u793C\uFF0C\u6211\u77E5\u9053\u3002<br> We&#39;ll do this again soon.<br> \u6211\u4EEC\u5F88\u5FEB\u4F1A\u518D\u6709\u673A\u4F1A\u7684\u3002</p></blockquote><h1 id="_2-s02e22" tabindex="-1">2. S02E22 <a class="header-anchor" href="#_2-s02e22" aria-hidden="true">#</a></h1><h2 id="_2-1-00-29-53-00-29-54" tabindex="-1">2.1. 00:29:53--00:29:54 <a class="header-anchor" href="#_2-1-00-29-53-00-29-54" aria-hidden="true">#</a></h2><p>S:</p><blockquote><p>[Peng\u2026]<br> \u3010\u7830\u2026\u3011</p></blockquote><p>R:</p><blockquote><p>Uh~<br> \u554A~</p></blockquote>',41),i=[n];function l(b,u,h,s,c,p){return o(),t("div",null,i)}var f=e(a,[["render",l]]);export{k as __pageData,f as default};
